import React from 'react';
import styles from '../styles/code.module.css';  // تغییر مسیر به /styles
import rectangleImage from '../assets/images/Rectangle.png';  // ایمپورت تصویر

const LeftPanel = () => {
  return (
    <div className={styles.leftPanel}>
      <h1 className={styles.title}>پارس نگار</h1>
      <div className={styles.imageWrapper}>
        <div className={styles.imageBox}>
          <img src={rectangleImage} alt="کاخ" />  {/* استفاده از تصویر */}
        </div>
      </div>
      <div className={styles.rectangles}>
        <div></div><div></div><div></div>
      </div>
    </div>
  );
};

export default LeftPanel;
